import React, { useEffect, useState } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";

const InvestmentTable = () => {
    const [investmentData, setInvestmentData] = useState([]);
    const [hoveredCategoryId, setHoveredCategoryId] = useState(null);
    const [hoveredMaturityId, setHoveredMaturityId] = useState(null);
    const navigate = useNavigate();

    useEffect(() => {
        axios.get('/api/investment/list')
            .then(response => {
                setInvestmentData(response.data);
            })
            .catch(error => {
                console.error("There was an error fetching the investment data!", error);
            });
    }, []);

    const handleCategoryHover = (investmentId) => {
        setHoveredCategoryId(investmentId);
    };

    const handleCategoryLeave = () => {
        setHoveredCategoryId(null);
    };

    const handleMaturityHover = (investmentId) => {
        setHoveredMaturityId(investmentId);
    };

    const handleMaturityLeave = () => {
        setHoveredMaturityId(null);
    };

    const handleEditClick = (investmentId) => {
        navigate(`/investment/edit/${investmentId}`);
    };

    return (
        <div className="container mt-4">
            <table className="table table-hover table-bordered table-responsive">
                <thead className="table-light">
                    <tr>
                        <th>Investment Date</th>
                        <th>Category</th>
                        <th>Maturity Date</th>
                        <th>Maturity Amount</th>
                        <th>Edit/Update</th>
                    </tr>
                </thead>
                <tbody>
                    {investmentData.map((investment) => (
                        <React.Fragment key={investment.investmentId}>
                            <tr>
                                <td>{new Date(investment.investmentDate).toLocaleDateString()}</td>
                                <td 
                                    style={{ cursor: "pointer", color: "blue", textDecoration: "underline" }}
                                    onMouseEnter={() => handleCategoryHover(investment.investmentId)}
                                    onMouseLeave={handleCategoryLeave}
                                >
                                    {investment.category}
                                </td>
                                <td>{new Date(investment.maturityDate).toLocaleDateString()}</td>
                                <td
                                    style={{ cursor: "pointer", color: "blue", textDecoration: "underline" }}
                                    onMouseEnter={() => handleMaturityHover(investment.investmentId)}
                                    onMouseLeave={handleMaturityLeave}
                                >
                                    {investment.maturityAmount}
                                </td>
                                <td>
                                    <button 
                                        className="btn btn-primary btn-sm" 
                                        onClick={() => handleEditClick(investment.investmentId)}
                                    >
                                        Edit
                                    </button>
                                </td>
                            </tr>
                            {hoveredCategoryId === investment.investmentId && (
                                <tr>
                                    <td colSpan="5" className="bg-light">
                                        <strong>Description:</strong> {investment.description}
                                    </td>
                                </tr>
                            )}
                            {hoveredMaturityId === investment.investmentId && (
                                <tr>
                                    <td colSpan="5" className="bg-light">
                                        <div><strong>Maturity Unit Price:</strong> {investment.maturityUnitPrice}</div>
                                        <div><strong>Quantity:</strong> {investment.quantity}</div>
                                        <div><strong>Unit Cost:</strong> {investment.unitCost}</div>
                                        <div><strong>Issuer:</strong> {investment.issuer}</div>
                                    </td>
                                </tr>
                            )}
                        </React.Fragment>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

export default InvestmentTable;
